import React from "react";
import { NavLink } from "react-router-dom";
import { useTranslation } from "react-i18next";
import "../../styles/AdminMenu.css";

const AdminMenu = () => {
  const { t } = useTranslation();
  return (
    <div className="text-center">
      <div className="list-group dashboard-menu">
        <h4>{t("AdminMenu:AdminPanel")}</h4>
        <NavLink
          to="/dashboard/admin/create-dropshippingProduct"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:createDropShippingProducts")}
        </NavLink>

        <NavLink
          to="/dashboard/admin/dropShippingProducts"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:dropShippingProducts")}
        </NavLink>

        <NavLink
          to="/dashboard/admin/create-product"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:CreateProduct")}
        </NavLink>

        <NavLink
          to="/dashboard/admin/create-category"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:CreateCategory")}
        </NavLink>

        <NavLink
          to="/dashboard/admin/products"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:products")}
        </NavLink>

        <NavLink
          to="/dashboard/admin/create-post"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:createPost")}
        </NavLink>
        <NavLink
          to="/dashboard/admin/posts"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:posts")}
        </NavLink>

        <NavLink
          to="/dashboard/admin/orders"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:Orders")}
        </NavLink>
        <NavLink
          to="/dashboard/admin/users"
          className="list-group-item list-group-item-action"
        >
          {t("AdminMenu:users")}
        </NavLink>
      </div>
    </div>
  );
};

export default AdminMenu;
